(1, 'محصول یک', '15000', 'محصول یک، یک محصول کاربردی است.', '2025-01-05 16:13:35.000000'),
(2, 'محصول2', '7463453', 'این محصول که محصول دو نام دارد نیز یک محصول سطحی است که استفاده های کوچک و خاصی دارد', '2025-01-05 16:14:12.000000'),
(3, 'محصول خط شکن', '43543', 'این محصول به قیمت دلار بسیار بستگی دارد و استفاده از این محصول میتواند نرخ نهایی کالای قابل فروش را تا حد قابل توجهی بالا ببرد.', '2025-01-05 16:14:56.000000'),
(4, 'محصول 0', '1000', 'محصول 0 محصول بسیار خوبی است و درباره آن میشود گفت که یک محصول بی نظیر و کاربردی است و بنظر شخص کارشناس خریدو فروش مجموعه محصولی است که میتواند جایگزین خوبی برای رقبای خارجی خود باشد از این رو باید گفت که این محصول یک فناوری و یک ایده نو میباشد که باید از عوامل خرید و همچنین تولید آن تشکر به عمل آورد.', '2025-01-05 21:13:55.263744'),
